package com.example.myapplication;

import android.content.pm.ApplicationInfo;
import android.content.pm.PackageManager;
import android.graphics.Bitmap;
import android.graphics.BitmapFactory;
import android.graphics.drawable.Drawable;
import android.util.Base64;
import java.util.ArrayList;
import java.util.List;

public class MagiskIconChecker {

    private static final String[] magiskEncodedIcons = new String[]{
            "",
            "",
            "",
    };
    private PHash phash;
    private List<Long> magiskHashes;
    private MainActivity activity;
    private PackageManager pm;

    public MagiskIconChecker(MainActivity activity) {
        phash = new PHash();
        magiskHashes = new ArrayList<Long>();
        for (String magiskEncodedIcon: magiskEncodedIcons) {
            byte[] magiskIconBytes = Base64.decode(magiskEncodedIcon, Base64.DEFAULT);
            Bitmap magiskIcon = BitmapFactory.decodeByteArray(magiskIconBytes, 0, magiskIconBytes.length);
            long hash = phash.getHash(magiskIcon);
            magiskHashes.add(hash);
        }
        this.activity = activity;
        this.pm = activity.getPackageManager();
    }

    private void addText(String txt) {
        activity.addText(txt);
    }

    private int getMagiskIconDistance(Drawable icon) {
        int shorterDistance = Long.SIZE;
        long hashApp = phash.getHash(icon);
        /* comparando com icones do magisk */
        for (long magiskHash : magiskHashes) {
            int curDistance = phash.distance(hashApp, magiskHash);
            shorterDistance = Math.min(shorterDistance, curDistance);
        }
        return shorterDistance;
    }

    public boolean checkIcons() {
        List<ApplicationInfo> packages = pm.getInstalledApplications(0);
        /* para cada aplicativo instalado */
        for (ApplicationInfo info : packages) {
            try {
                String pkgName = info.packageName;
                Drawable icon = pm.getApplicationIcon(pkgName);
                int distance = getMagiskIconDistance(icon);
                addText("[*] d: " + distance + ", p: " + pkgName);
                /* quanto menor a distancia,
                   mais semelhantes sao as imagens */
                if (distance <= 1) {
                    addText("\n\n[+] Magisk Manager found!\n" +
                            "-> " + pkgName + "\n\n");
                    return true;
                }
            } catch (Exception e) {  }
        }
        addText("\n[-] Magisk Manager not found!\n");
        return false;
    }
}
